import React, { useEffect, useState } from 'react';
import {
  Box,
  TextField,
  MenuItem,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Button,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  IconButton
} from '@mui/material';
import { styled } from '@mui/material/styles';
import CloseIcon from '@mui/icons-material/Close';
import { Formik, Form, Field } from 'formik';
import axios from 'axios';
import InteviewPortal from './InteviewPortal';

// Styled Components
const BootstrapDialog = styled(Dialog)(({ theme }) => ({
  '& .MuiDialogContent-root': { padding: theme.spacing(2) },
  '& .MuiDialogActions-root': { padding: theme.spacing(1) }
}));

const StyledTableCell = styled(TableCell)(({ theme }) => ({
  [`&.${tableCellClasses.head}`]: {
    backgroundColor: '#1976d2',
    color: theme.palette.common.white
  },
  [`&.${tableCellClasses.body}`]: { fontSize: 14 }
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  '&:nth-of-type(odd)': { backgroundColor: theme.palette.action.hover },
  '&:last-child td, &:last-child th': { border: 0 }
}));

const SubCatagary = () => {
  const [open, setOpen] = useState(false);
  const [list, setList] = useState([]);
  const [initialValues, setInitialValues] = useState({
    subCategoryName: '',
    categoryID: ''
  });

  // Open/Close Dialog
  const handleClickOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  // Fetch Data
  const dataView = () => {
    axios
      .get('https://interviewback-ucb4.onrender.com/subcatagory/', {
        headers: {
          Authorization:
            "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjY3ODA4YTE3MzRkZGY2ZjZlZGUyNTRmMSIsImlhdCI6MTc0Mjc5Njg3OX0.VhjRg_oGm9skgXMpeoVr5BzXF_1CYCdgaGYn8WCL_aM"
        }
      })
      .then((res) => {
        setList(res.data.data);
      })
      .catch((error) => console.error("Error fetching data:", error));
  };

  useEffect(() => {
    dataView();
  }, []);

  // Handle Form Submission
  const handleSubmit = (values, { resetForm }) => {
    axios
      .post('https://interviewback-ucb4.onrender.com/subcatagory/create', values, {
        headers: {
          Authorization:
            "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjY3ODA4YTE3MzRkZGY2ZjZlZGUyNTRmMSIsImlhdCI6MTc0Mjc5Njg3OX0.VhjRg_oGm9skgXMpeoVr5BzXF_1CYCdgaGYn8WCL_aM"
        }
      })
      .then(() => {
        dataView();
        resetForm();
        handleClose();
      })
      .catch((error) => console.error("Error submitting form:", error));
  };

  return (
    <InteviewPortal>
      <Box sx={{ width: '100%', display: 'flex', flexWrap: 'wrap' }}>
        {/* Search Box */}
        <Box component="form" sx={{ width: { lg: '80%', md: '100%', sm: '100%', xs: '100%' } }} noValidate autoComplete="off">
          <TextField
            id="outlined-select-category"
            select
            label="Search Category"
            sx={{ width: '100%' }}
          >
            {/* Dropdown Options Example (Replace with API Data) */}
            <MenuItem value="Category1">Category 1</MenuItem>
            <MenuItem value="Category2">Category 2</MenuItem>
          </TextField>
        </Box>

        {/* Add Sub-Category Button */}
        <Box sx={{ width: { lg: '20%', md: '100%', sm: '100%', xs: '100%' }, display: 'flex', justifyContent: 'center', padding: '10px 0px' }}>
          <Button sx={{ backgroundColor: '#1976d2', color: 'white', width: '100%' }} onClick={handleClickOpen}>
            ADD SUB-CATEGORY
          </Button>

          {/* Dialog Box */}
          <BootstrapDialog onClose={handleClose} aria-labelledby="customized-dialog-title" open={open}>
            <DialogTitle sx={{ m: 0, p: 2 }} id="customized-dialog-title">
              Add Sub-Category
            </DialogTitle>
            <IconButton
              aria-label="close"
              onClick={handleClose}
              sx={(theme) => ({ position: 'absolute', right: 8, top: 8, color: theme.palette.grey[500] })}
            >
              <CloseIcon />
            </IconButton>

            {/* Form */}
            <Formik initialValues={initialValues} onSubmit={handleSubmit}>
              {({ handleSubmit }) => (
                <Form onSubmit={handleSubmit}>
                  <DialogContent dividers sx={{ display: 'flex', flexDirection: 'column', gap: 2 }}>
                    <Field as={TextField} name="subCategoryName" label="Subcategory Name" required fullWidth />
                    <Field as={TextField} name="categoryID" label="Category ID" required fullWidth />
                  </DialogContent>
                  <DialogActions>
                    <Button type="submit" sx={{ backgroundColor: '#1976d2', color: 'white' }}>
                      Submit
                    </Button>
                  </DialogActions>
                </Form>
              )}
            </Formik>
          </BootstrapDialog>
        </Box>
      </Box>

      {/* Table */}
      <TableContainer component={Paper}>
        <Table sx={{ minWidth: 700 }} aria-label="customized table">
          <TableHead>
            <TableRow>
              <StyledTableCell>No.</StyledTableCell>
              <StyledTableCell align="left">Sub-Category Name</StyledTableCell>
              <StyledTableCell align="left">Category Name</StyledTableCell>
              <StyledTableCell align="right">Status</StyledTableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {list.map((row, i) => (
              <StyledTableRow key={i}>
                <StyledTableCell>{i + 1}</StyledTableCell>
                <StyledTableCell align="left">{row.subCategoryName}</StyledTableCell>
                <StyledTableCell align="left">{row.categoryName}</StyledTableCell>
                <StyledTableCell align="right">{row.status}</StyledTableCell>
              </StyledTableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </InteviewPortal>
  );
};

export default SubCatagary;
